import React from "react";

import classes from "./Tachas.module.css";
import ArrowForwardIosIcon from "@material-ui/icons/ArrowForwardIos";

const Tachas = (props) => {

  const arrayClasses=[classes.summary, classes.fill];
  const arrayClasses1=[classes.tiposTachas, classes.open]
  const arrayClasses2=[classes.tipo, classes.fill2];
  const opciones = props.tachas.map((tacha, i) => (
    <div className={classes.item}>
      <div className={classes.itemHeader}>
        <span className={classes.arrow}><ArrowForwardIosIcon /></span>
      <span className={classes.title}>{tacha.tamanio}</span>
      <span className={classes.price}>$ {tacha.precio}</span>
      </div>
    </div>
  ));
//https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcSD3X3H8ZEFWdCdWTqajSGyHUw8pDPiSxgcoA&usqp=CAU

  return (
    <div className={classes.Tachas}>
      <h2>Tachas</h2>
      <div>
        {opciones}  
      </div> 
    </div>
  );
};

export default Tachas;
